import React from 'react'
function Heading(props){
const style={
color:"#474554",
fontSize:`${props.size}`,
fontFamily:"'PT Serif', serif",
textAlign:"center",
margin:"0.1px"


}
return(
    <h1 style={style}>{props.text}</h1>
)



}
export default Heading;
